import React from 'react';
import { Sidebar, Menu, Icon } from 'semantic-ui-react';
import { Link } from 'react-router-dom';

class Sidenav extends React.Component {
  render() {
    return (
      <Sidebar
        as={Menu}
      >
        <Menu.Item as='a'>
          <Icon name='server' />
          <Link path='/'> Dashboard </Link>
        </Menu.Item>
      </Sidebar>
    )
  }
}

export default Sidenav;
